import CreditCard from '../../components/CreditCard/CreditCard'
import LoginPage from '../LoginPage/LoginPage'
import styles from './YourPaymentsPage.module.scss'
import {useEffect, useState} from 'react'
import { getOrderHistory } from '../../utilities/orders-api.cjs'
import { Link } from 'react-router-dom'
import Footer from '../../components/Footer/Footer'
export default function YourPaymentPage({user,setUser}){
    const [userOrders, setUserOrders] = useState([])
    const [tabClick, setTabClick]= useState(false)
    const [blueClicked, setBlueClicked] = useState(false)
    const [platinumClicked, setPlatinumClicked] = useState(false)
    const [goldClicked, setGoldClicked] = useState(false)
    const [nothingClicked, setNothingClicked] = useState(true)


    useEffect(function(){
        async function fetchOrderHistory(){
            const orders = await getOrderHistory()

            setUserOrders(orders)
        }
        fetchOrderHistory()
    },[])


    const preOrders = []
    for(let oldOrder of userOrders){

        preOrders.push(oldOrder.lineItems)
    }




    function handleTabClick(e){
        const innerText = e.target.innerText
        if(innerText=== 'Transactions'){
            setTabClick(true)
        } else if(innerText==='Wallet'){
            setTabClick(false)
        }
    
    }
    const allItems = []
    for(let order of preOrders){
        for(let eachOrder of order){

            allItems.push(eachOrder)
        }
    }

    function handleCardClick(e){
        const imgURL = e.target.src
        const blueURL = 'https://ma.visamiddleeast.com/dam/VCOM/regional/ap/taiwan/global-elements/images/tw-visa-gold-card-498x280.png'
        const platinumURL = 'data:image/jpeg;base64,'
        const goldURL = 'https://www.visa.ca/dam/VCOM/regional/na/canada/pay-with-visa/cards/credit/visa-gold-recto-800x450.jpg'

        
        if(imgURL === blueURL){
            setBlueClicked(true)
            setPlatinumClicked(false)
            setGoldClicked(false)
            setNothingClicked(false)
        } else if(imgURL === platinumURL){
            setBlueClicked(false)
            setPlatinumClicked(true)
            setGoldClicked(false)
            setNothingClicked(false)
            
        } else if (imgURL === goldURL){
            setBlueClicked(false)
            setPlatinumClicked(false)
            setGoldClicked(true)
            setNothingClicked(false)
            
        } else{
            setBlueClicked(false)
            setPlatinumClicked(false)
            setGoldClicked(false)
            setNothingClicked(false)
            
        }

    }
    return(
        <div className={styles.YourPaymentsPage}>
            {user?
            <>
           <div onClick={handleTabClick} className={styles.header}>
            <p className={styles.title}><img src='https://selenakitt.com/wp-content/files/scamazon.png'/> Pay</p>
            <p>Wallet</p>
            <p>Transactions</p>
            
           </div>
           {tabClick?
           <div className={styles.transactionsTab}>
            <h1>Transactions</h1>
                <h6>Completed</h6>
            <div className={styles.transactionsDiv} >
                <section>
                    {
                        allItems.map((item)=>{
                            return <Link to={`/item/${item.item._id}`}><div className={styles.itemCard}  style={{color:'black'}} >
                                <div className={styles.imageSide}>

                                <p className={styles.itemName} >{item.item.name}</p>
                                <img  className={styles.itemImage} src={item.item.image}/>
                                </div>
                                <div className={styles.descriptionSide}>

                                <p className={styles.itemQty} >{item.quantity}</p>
                                <p className={styles.itemExtPrice} >${item.extPrice}</p>
                                <p className={styles.itemId} >OrderID-{item._id.substring(0,5)}</p>
                                </div>

                                </div></Link>
                        })
                    }
                </section>
            </div>
           </div>
           :
           <div className={styles.walletTab}>
            <div className={styles.headers}>
            <h1>Wallet</h1>
            <h2>Cards and accounts</h2>

            </div>
            <div className={styles.cardsDiv}>

            <section className={styles.cardsList}>
                
                {blueClicked?
                <div className={styles.clickedCard} onClick={handleCardClick}> <CreditCard  user={user} title={'Blue'} imgSrc={'https://ma.visamiddleeast.com/dam/VCOM/regional/ap/taiwan/global-elements/images/tw-visa-gold-card-498x280.png'}/></div>
                :
                <div onClick={handleCardClick}> <CreditCard  user={user} title={'Blue'} imgSrc={'https://ma.visamiddleeast.com/dam/VCOM/regional/ap/taiwan/global-elements/images/tw-visa-gold-card-498x280.png'}/></div>
            }
            {platinumClicked?
            
            <div className={styles.clickedCard}  onClick={handleCardClick}> <CreditCard user={user} title={'Platinum'} imgSrc={'data:image/jpeg;base64,'}/></div>
            :
            
            <div onClick={handleCardClick}> <CreditCard user={user} title={'Platinum'} imgSrc={'data:image/jpeg;base64,'}/></div>
        }
            {goldClicked?
            
            <div className={styles.clickedCard} onClick={handleCardClick}> <CreditCard user={user} title={'Gold'} imgSrc={'https://www.visa.ca/dam/VCOM/regional/na/canada/pay-with-visa/cards/credit/visa-gold-recto-800x450.jpg'}/></div>
            :
            
            <div onClick={handleCardClick}> <CreditCard user={user} title={'Gold'} imgSrc={'https://www.visa.ca/dam/VCOM/regional/na/canada/pay-with-visa/cards/credit/visa-gold-recto-800x450.jpg'}/></div>
        }
            </section>
            <div className={styles.cardShow}> 
            {nothingClicked?
        <h1 className={styles.clickPrompt}>Click on a Card to View Details...</h1> 
        :
        <></>   
    }

            {blueClicked?
            <>
           

            <h1>Visa Blue</h1>
            <img  src="https://ma.visamiddleeast.com/dam/VCOM/regional/ap/taiwan/global-elements/images/tw-visa-gold-card-498x280.png"/>
            <h3>Credit Card ending in **** 9010</h3>
            <h4>Edit | Remove</h4>
            
            </>
            :
            <></>    
        }
            {platinumClicked?
            <>

            <h1>Visa Platinum</h1>
            <img  src="data:image/jpeg;base64,"/>
            <h3>Credit Card ending in **** 9010</h3>
            <h4>Edit | Remove</h4>
            </>
            :
            <></>    
        }
            {goldClicked?
            <>

        <h1>Visa Gold</h1>
            <img  src="https://www.visa.ca/dam/VCOM/regional/na/canada/pay-with-visa/cards/credit/visa-gold-recto-800x450.jpg"/>
            <h3>Credit Card ending in **** 9010</h3>
            <h4>Edit | Remove</h4>
            </>
            :
            <></>    
        }
            </div>
            </div>
                
           
           </div>
           }
           </>
           :
           <LoginPage user={user} setUser={setUser}/>
    }
    <Footer/>
        </div>
        )
    }